import { ReactNode, CSSProperties } from "react";

type Props = {
  children: ReactNode;
  style?: CSSProperties;
};

function Text({ children, style }: Props) {
  return (
    <text
      style={{
        color: "red",
        backgroundColor: "blue",
        fontSize: 48,
        ...style,
      }}
    >
      {children}
    </text>
  );
}
export default Text;
